<!DOCTYPE html>
<html lang="sk">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Cenový Radar SK</title>
<style>
    :root {
        --bg-color: #f3f3f3;
        --card-bg: #ffffff;
        --text-main: #202020;
        --text-sub: #606060;
        --accent: #0078d4;
        --accent-hover: #006cc1;
        --success: #107c10;
        --danger: #d13438;
        --border-radius: 8px;
        --shadow: 0 2px 8px rgba(0,0,0,0.08);
        --font-stack: 'Segoe UI', system-ui, -apple-system, sans-serif;
    }

    * { box-sizing: border-box; user-select: none; }

    body {
        margin: 0;
        padding: 0;
        font-family: var(--font-stack);
        background-color: var(--bg-color);
        color: var(--text-main);
        height: 100vh;
        overflow: hidden;
        display: flex;
        flex-direction: column;
    }

    /* Header */
    header {
        background: var(--card-bg);
        padding: 16px;
        box-shadow: 0 1px 4px rgba(0,0,0,0.05);
        z-index: 10;
    }

    .app-title {
        font-size: 18px;
        font-weight: 600;
        margin-bottom: 12px;
        display: flex;
        align-items: center;
        gap: 8px;
    }

    .app-title svg { width: 20px; height: 20px; fill: var(--accent); }

    .search-container {
        position: relative;
    }

    .search-input {
        width: 100%;
        padding: 8px 12px 8px 36px;
        border: 1px solid #e0e0e0;
        border-radius: 4px;
        font-size: 14px;
        outline: none;
        transition: border-color 0.2s;
        background: #f9f9f9;
    }

    .search-input:focus {
        border-color: var(--accent);
        background: #fff;
    }

    .search-icon {
        position: absolute;
        left: 10px;
        top: 50%;
        transform: translateY(-50%);
        width: 16px;
        height: 16px;
        fill: #888;
    }

    /* Navigation Tabs */
    .nav-tabs {
        display: flex;
        background: var(--card-bg);
        padding: 0 16px;
        border-bottom: 1px solid #eee;
    }

    .tab {
        flex: 1;
        text-align: center;
        padding: 12px 0;
        font-size: 13px;
        font-weight: 500;
        color: var(--text-sub);
        cursor: pointer;
        border-bottom: 2px solid transparent;
        transition: all 0.2s;
    }

    .tab.active {
        color: var(--accent);
        border-bottom-color: var(--accent);
    }

    /* Main Content Area */
    main {
        flex: 1;
        overflow-y: auto;
        padding: 12px;
        padding-bottom: 80px; /* Space for footer if needed */
    }

    /* Product Card */
    .product-card {
        background: var(--card-bg);
        border-radius: var(--border-radius);
        padding: 12px;
        margin-bottom: 10px;
        box-shadow: var(--shadow);
        display: flex;
        gap: 12px;
        transition: transform 0.1s, box-shadow 0.1s;
        cursor: pointer;
        position: relative;
    }

    .product-card:active { transform: scale(0.98); }

    .product-img {
        width: 60px;
        height: 60px;
        background: #f0f0f0;
        border-radius: 6px;
        display: flex;
        align-items: center;
        justify-content: center;
        font-size: 28px;
    }

    .product-info {
        flex: 1;
        display: flex;
        flex-direction: column;
        justify-content: center;
    }

    .product-name {
        font-weight: 600;
        font-size: 14px;
        margin-bottom: 4px;
    }

    .product-meta {
        font-size: 12px;
        color: var(--text-sub);
        display: flex;
        align-items: center;
        gap: 6px;
    }

    .price-tag {
        font-weight: 700;
        font-size: 16px;
        color: var(--text-main);
    }

    .trend-indicator {
        font-size: 11px;
        padding: 2px 6px;
        border-radius: 4px;
        display: flex;
        align-items: center;
        gap: 2px;
    }
    
    .trend-up { background: #ffebeb; color: var(--danger); }
    .trend-down { background: #e6ffeb; color: var(--success); }
    .trend-stable { background: #f0f0f0; color: var(--text-sub); }

    .store-badge {
        font-size: 10px;
        padding: 2px 4px;
        border-radius: 3px;
        background: #eee;
        color: #555;
        margin-left: auto;
    }

    /* Detail View Overlay */
    .overlay {
        position: absolute;
        top: 0; left: 0; right: 0; bottom: 0;
        background: rgba(0,0,0,0.4);
        z-index: 50;
        opacity: 0;
        pointer-events: none;
        transition: opacity 0.2s;
        display: flex;
        align-items: flex-end; /* Slide up from bottom */
    }

    .overlay.active {
        opacity: 1;
        pointer-events: auto;
    }

    .modal {
        background: var(--card-bg);
        width: 100%;
        height: 85%;
        border-radius: 16px 16px 0 0;
        padding: 20px;
        transform: translateY(100%);
        transition: transform 0.3s cubic-bezier(0.1, 0.9, 0.2, 1);
        display: flex;
        flex-direction: column;
    }

    .overlay.active .modal { transform: translateY(0); }

    .modal-header {
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin-bottom: 20px;
    }

    .close-btn {
        background: #f0f0f0;
        border: none;
        width: 30px;
        height: 30px;
        border-radius: 50%;
        font-size: 18px;
        cursor: pointer;
        display: flex;
        align-items: center;
        justify-content: center;
    }

    .chart-container {
        width: 100%;
        height: 150px;
        background: #fafafa;
        border-radius: 8px;
        margin-bottom: 20px;
        position: relative;
        overflow: hidden;
        border: 1px solid #eee;
    }

    .store-list {
        display: flex;
        flex-direction: column;
        gap: 8px;
        overflow-y: auto;
    }

    .store-row {
        display: flex;
        justify-content: space-between;
        align-items: center;
        padding: 10px;
        border-radius: 6px;
        border: 1px solid #eee;
    }

    .store-row.best-price {
        border-color: var(--success);
        background: #f0fdf4;
    }

    .store-name { font-weight: 500; font-size: 14px; }
    .store-price { font-weight: 700; }

    .btn-action {
        background: var(--accent);
        color: white;
        border: none;
        padding: 12px;
        border-radius: 6px;
        font-weight: 600;
        margin-top: auto;
        cursor: pointer;
        display: flex;
        align-items: center;
        justify-content: center;
        gap: 8px;
    }
    
    .btn-action:active { background: var(--accent-hover); }

    /* Shopping List styles */
    .cart-summary {
        padding: 15px;
        background: #fff;
        border-top: 1px solid #eee;
        position: absolute;
        bottom: 0;
        width: 100%;
    }

    .cart-item {
        display: flex;
        justify-content: space-between;
        padding: 8px 0;
        border-bottom: 1px solid #eee;
        font-size: 14px;
    }
    
    .delete-item {
        color: var(--danger);
        cursor: pointer;
        margin-left: 10px;
        font-weight: bold;
    }

    /* Scrollbar */
    ::-webkit-scrollbar { width: 6px; }
    ::-webkit-scrollbar-thumb { background: #ccc; border-radius: 3px; }
    ::-webkit-scrollbar-track { background: transparent; }

    /* Mobile Mode overrides */
    body.mobile-mode {
        font-size: 16px;
    }
    body.mobile-mode .product-card {
        padding: 16px;
    }
    body.mobile-mode .btn-action {
        padding: 16px;
    }
</style>
</head>
<body>

<header>
    <div class="app-title">
        <svg viewBox="0 0 24 24"><path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm1 15h-2v-6h2v6zm0-8h-2V7h2v2z"/></svg>
        Cenový Radar SK
    </div>
    <div class="search-container">
        <svg class="search-icon" viewBox="0 0 24 24"><path d="M15.5 14h-.79l-.28-.27C15.41 12.59 16 11.11 16 9.5 16 5.91 13.09 3 9.5 3S3 5.91 3 9.5 5.91 16 9.5 16c1.61 0 3.09-.59 4.23-1.57l.27.28v.79l5 4.99L20.49 19l-4.99-5zm-6 0C7.01 14 5 11.99 5 9.5S7.01 5 9.5 5 14 7.01 14 9.5 11.99 14 9.5 14z"/></svg>
        <input type="text" class="search-input" placeholder="Hľadať (napr. Maslo, Horalky)..." id="searchInput">
    </div>
</header>

<div class="nav-tabs">
    <div class="tab active" data-tab="search">Ceny</div>
    <div class="tab" data-tab="list">Nákupný Zoznam <span id="cartCount">(0)</span></div>
</div>

<main id="mainContainer">
    <!-- Content injected via JS -->
</main>

<!-- Details Modal -->
<div class="overlay" id="detailOverlay">
    <div class="modal">
        <div class="modal-header">
            <div>
                <h2 style="margin:0; font-size: 20px;" id="modalTitle">Product</h2>
                <span style="font-size: 13px; color: #666;" id="modalCategory">Category</span>
            </div>
            <button class="close-btn" id="closeModal">&times;</button>
        </div>
        
        <div style="font-size: 12px; margin-bottom: 8px; color: #888;">Vývoj ceny (30 dní)</div>
        <div class="chart-container" id="priceChart">
            <!-- SVG Chart -->
        </div>

        <div style="font-size: 12px; margin-bottom: 8px; color: #888;">Porovnanie obchodov</div>
        <div class="store-list" id="modalStoreList">
            <!-- Stores -->
        </div>

        <button class="btn-action" id="addToCartBtn">
            <svg style="width:20px;height:20px;fill:currentColor" viewBox="0 0 24 24"><path d="M19 13h-6v6h-2v-6H5v-2h6V5h2v6h6v2z"/></svg>
            Pridať do zoznamu
        </button>
    </div>
</div>

<script>
    /* Audio System */
    const AudioCtx = window.AudioContext || window.webkitAudioContext;
    const ctx = new AudioCtx();

    function playSound(type) {
        if (ctx.state === 'suspended') ctx.resume();
        const osc = ctx.createOscillator();
        const gain = ctx.createGain();
        osc.connect(gain);
        gain.connect(ctx.destination);

        const now = ctx.currentTime;
        
        if (type === 'hover') {
            osc.frequency.setValueAtTime(400, now);
            gain.gain.setValueAtTime(0.05, now);
            gain.gain.exponentialRampToValueAtTime(0.001, now + 0.05);
            osc.start(now);
            osc.stop(now + 0.05);
        } else if (type === 'click') {
            osc.frequency.setValueAtTime(600, now);
            gain.gain.setValueAtTime(0.1, now);
            gain.gain.exponentialRampToValueAtTime(0.001, now + 0.1);
            osc.start(now);
            osc.stop(now + 0.1);
        } else if (type === 'success') {
            osc.type = 'sine';
            osc.frequency.setValueAtTime(500, now);
            osc.frequency.exponentialRampToValueAtTime(1000, now + 0.2);
            gain.gain.setValueAtTime(0.1, now);
            gain.gain.linearRampToValueAtTime(0, now + 0.3);
            osc.start(now);
            osc.stop(now + 0.3);
        }
    }

    /* Mock Data */
    const STORES = ['Tesco', 'Lidl', 'Billa', 'Kaufland'];
    
    // Helper to generate random price history
    function generateHistory(basePrice) {
        let history = [];
        let current = basePrice;
        for(let i=0; i<30; i++) {
            current = current + (Math.random() - 0.5) * 0.4;
            if(current < basePrice * 0.7) current = basePrice * 0.7;
            if(current > basePrice * 1.5) current = basePrice * 1.5;
            history.push(Number(current.toFixed(2)));
        }
        return history;
    }

    const PRODUCTS = [
        { id: 1, name: 'I.D.C. Horalky', size: '50g', cat: 'Sladkosti', icon: '🍪', basePrice: 0.59 },
        { id: 2, name: 'Kofola Original', size: '2L', cat: 'Nápoje', icon: '🥤', basePrice: 1.49 },
        { id: 3, name: 'Rajo Maslo 82%', size: '250g', cat: 'Mliečne', icon: '🧈', basePrice: 2.89 },
        { id: 4, name: 'Rajo Mlieko 1.5%', size: '1L', cat: 'Mliečne', icon: '🥛', basePrice: 0.95 },
        { id: 5, name: 'Treska v majonéze', size: '140g', cat: 'Ryby', icon: '🐟', basePrice: 1.29 },
        { id: 6, name: 'Chlieb Konzumný', size: '1kg', cat: 'Pečivo', icon: '🍞', basePrice: 1.69 },
        { id: 7, name: 'Rožok biely', size: '40g', cat: 'Pečivo', icon: '🥐', basePrice: 0.13 },
        { id: 8, name: 'Vajcia M', size: '10ks', cat: 'Vajcia', icon: '🥚', basePrice: 2.49 },
        { id: 9, name: 'Banány', size: '1kg', cat: 'Ovocie', icon: '🍌', basePrice: 1.69 },
        { id: 10, name: 'Zemiaky', size: '2kg', cat: 'Zelenina', icon: '🥔', basePrice: 2.29 },
        { id: 11, name: 'Kuracie prsia', size: '1kg', cat: 'Mäso', icon: '🍗', basePrice: 6.99 },
        { id: 12, name: 'Pilsner Urquell', size: '0.5L', cat: 'Alkohol', icon: '🍺', basePrice: 1.19 },
    ].map(p => {
        // Generate store prices based on base price with variance
        const storePrices = {};
        STORES.forEach(s => {
            let variance = (Math.random() - 0.5) * (p.basePrice * 0.3);
            storePrices[s] = Number((p.basePrice + variance).toFixed(2));
        });
        
        // Determine trend
        const history = generateHistory(p.basePrice);
        const currentAvg = STORES.reduce((acc, s) => acc + storePrices[s], 0) / STORES.length;
        const lastWeekAvg = history[history.length - 7];
        const trend = currentAvg < lastWeekAvg ? 'down' : (currentAvg > lastWeekAvg * 1.05 ? 'up' : 'stable');

        return { ...p, storePrices, history, trend };
    });

    /* State */
    let cart = [];
    let currentTab = 'search';
    let searchQuery = '';
    let selectedProduct = null;

    /* DOM Elements */
    const mainContainer = document.getElementById('mainContainer');
    const searchInput = document.getElementById('searchInput');
    const tabs = document.querySelectorAll('.tab');
    const overlay = document.getElementById('detailOverlay');
    const closeModalBtn = document.getElementById('closeModal');
    const addToCartBtn = document.getElementById('addToCartBtn');
    const cartCount = document.getElementById('cartCount');

    /* Initialization */
    function init() {
        // Check for mobile mode
        if (document.body.classList.contains('mobile-mode')) {
            // Apply specific adjustments if needed via JS, though CSS usually handles it
        }

        renderSearchTab();

        // Event Listeners
        searchInput.addEventListener('input', (e) => {
            searchQuery = e.target.value.toLowerCase();
            if (currentTab === 'search') renderSearchTab();
        });

        tabs.forEach(tab => {
            tab.addEventListener('click', () => {
                playSound('click');
                tabs.forEach(t => t.classList.remove('active'));
                tab.classList.add('active');
                currentTab = tab.dataset.tab;
                render();
            });
        });

        closeModalBtn.addEventListener('click', closeDetails);
        addToCartBtn.addEventListener('click', () => {
            if (selectedProduct) {
                cart.push(selectedProduct);
                playSound('success');
                updateCartCount();
                closeDetails();
            }
        });
    }

    /* Rendering */
    function render() {
        mainContainer.innerHTML = '';
        if (currentTab === 'search') renderSearchTab();
        else renderListTab();
    }

    function renderSearchTab() {
        const filtered = PRODUCTS.filter(p => p.name.toLowerCase().includes(searchQuery) || p.cat.toLowerCase().includes(searchQuery));
        
        if (filtered.length === 0) {
            mainContainer.innerHTML = `<div style="text-align:center; padding: 40px; color:#999;">Žiadne výsledky pre "${searchQuery}"</div>`;
            return;
        }

        filtered.forEach(p => {
            // Find best price
            const bestPrice = Math.min(...Object.values(p.storePrices));
            const bestStore = Object.keys(p.storePrices).find(key => p.storePrices[key] === bestPrice);

            const card = document.createElement('div');
            card.className = 'product-card';
            card.onclick = () => openDetails(p);
            
            let trendHtml = '';
            if(p.trend === 'down') trendHtml = `<span class="trend-indicator trend-down">▼ Klesá</span>`;
            if(p.trend === 'up') trendHtml = `<span class="trend-indicator trend-up">▲ Stúpa</span>`;
            if(p.trend === 'stable') trendHtml = `<span class="trend-indicator trend-stable">Stabilná</span>`;

            card.innerHTML = `
                <div class="product-img">${p.icon}</div>
                <div class="product-info">
                    <div class="product-name">${p.name} <span style="font-weight:400; color:#888;">(${p.size})</span></div>
                    <div class="product-meta">
                        ${trendHtml}
                        <div class="store-badge">Najlepšia cena: ${bestStore}</div>
                    </div>
                </div>
                <div style="display:flex; flex-direction:column; justify-content:center; align-items:flex-end;">
                    <div class="price-tag">${bestPrice.toFixed(2)} €</div>
                </div>
            `;
            
            // Interaction sound
            card.addEventListener('mouseenter', () => playSound('hover'));

            mainContainer.appendChild(card);
        });
    }

    function renderListTab() {
        if (cart.length === 0) {
            mainContainer.innerHTML = `
                <div style="text-align:center; padding: 60px 20px; color:#999; display:flex; flex-direction:column; align-items:center;">
                    <svg style="width:48px;height:48px;fill:#ddd;margin-bottom:16px" viewBox="0 0 24 24"><path d="M7 18c-1.1 0-1.99.9-1.99 2S5.9 22 7 22s2-.9 2-2-.9-2-2-2zM1 2v2h2l3.6 7.59-1.35 2.45c-.16.28-.25.61-.25.96 0 1.1.9 2 2 2h12v-2H7.42c-.14 0-.25-.11-.25-.25l.03-.12.9-1.63h7.45c.75 0 1.41-.41 1.75-1.03l3.58-6.49c.08-.14.12-.31.12-.48 0-.55-.45-1-1-1H5.21l-.94-2H1zm16 16c-1.1 0-1.99.9-1.99 2s.89 2 1.99 2 2-.9 2-2-.9-2-2-2z"/></svg>
                    Váš nákupný zoznam je prázdny.<br>Pridajte produkty z vyhľadávania.
                </div>
            `;
            return;
        }

        // List Items
        const listContainer = document.createElement('div');
        listContainer.style.paddingBottom = '160px'; // Space for totals
        
        cart.forEach((item, index) => {
            const row = document.createElement('div');
            row.className = 'product-card';
            row.style.cursor = 'default';
            row.style.marginBottom = '8px';
            row.style.padding = '10px';
            row.innerHTML = `
                <div style="font-size:24px; margin-right:10px;">${item.icon}</div>
                <div style="flex:1;">
                    <div style="font-weight:600; font-size:14px;">${item.name}</div>
                    <div style="font-size:12px; color:#666;">~ ${Math.min(...Object.values(item.storePrices)).toFixed(2)} €</div>
                </div>
                <div class="delete-item" onclick="removeFromCart(${index})">✕</div>
            `;
            listContainer.appendChild(row);
        });

        mainContainer.appendChild(listContainer);

        // Totals Footer
        const footer = document.createElement('div');
        footer.className = 'cart-summary';
        
        // Calculate total for each store
        let storeTotals = {};
        STORES.forEach(s => storeTotals[s] = 0);
        
        cart.forEach(item => {
            STORES.forEach(s => {
                storeTotals[s] += item.storePrices[s];
            });
        });

        // Find best total
        const minTotal = Math.min(...Object.values(storeTotals));

        let totalsHtml = `<div style="font-weight:bold; margin-bottom:10px;">Odhadovaná cena nákupu:</div>`;
        
        // Sort stores by price
        const sortedStores = STORES.sort((a,b) => storeTotals[a] - storeTotals[b]);

        sortedStores.forEach(s => {
            const isBest = storeTotals[s] === minTotal;
            const color = isBest ? 'var(--success)' : '#444';
            const weight = isBest ? 'bold' : 'normal';
            const bg = isBest ? '#e6ffeb' : 'transparent';
            
            totalsHtml += `
                <div style="display:flex; justify-content:space-between; padding:4px 8px; border-radius:4px; background:${bg}; color:${color}; font-weight:${weight}; margin-bottom:4px;">
                    <span>${s}</span>
                    <span>${storeTotals[s].toFixed(2)} €</span>
                </div>
            `;
        });

        footer.innerHTML = totalsHtml;
        mainContainer.appendChild(footer);
    }

    function removeFromCart(index) {
        playSound('click');
        cart.splice(index, 1);
        updateCartCount();
        renderListTab();
    }

    function updateCartCount() {
        cartCount.textContent = `(${cart.length})`;
    }

    /* Detail Logic */
    function openDetails(product) {
        playSound('click');
        selectedProduct = product;
        document.getElementById('modalTitle').innerText = product.name;
        document.getElementById('modalCategory').innerText = `${product.cat} • ${product.size}`;
        
        // Draw Chart
        drawChart(product.history);

        // Render Store List
        const storeList = document.getElementById('modalStoreList');
        storeList.innerHTML = '';
        
        // Sort stores by price for this product
        const sortedStores = STORES.slice().sort((a,b) => product.storePrices[a] - product.storePrices[b]);
        
        sortedStores.forEach((store, idx) => {
            const price = product.storePrices[store];
            const row = document.createElement('div');
            row.className = 'store-row' + (idx === 0 ? ' best-price' : '');
            
            row.innerHTML = `
                <div class="store-name">${store}</div>
                <div class="store-price">${price.toFixed(2)} €</div>
            `;
            storeList.appendChild(row);
        });

        overlay.classList.add('active');
    }

    function closeDetails() {
        overlay.classList.remove('active');
    }

    /* SVG Chart Drawing */
    function drawChart(data) {
        const container = document.getElementById('priceChart');
        const w = container.offsetWidth || 340;
        const h = 150;
        const pad = 10;
        
        const min = Math.min(...data) * 0.95;
        const max = Math.max(...data) * 1.05;
        const range = max - min;

        // Points
        const points = data.map((val, idx) => {
            const x = pad + (idx / (data.length - 1)) * (w - 2 * pad);
            const y = h - (pad + ((val - min) / range) * (h - 2 * pad));
            return `${x},${y}`;
        }).join(' ');

        // Create SVG
        const svgNs = "http://www.w3.org/2000/svg";
        const svg = document.createElementNS(svgNs, "svg");
        svg.setAttribute("width", "100%");
        svg.setAttribute("height", "100%");
        svg.setAttribute("viewBox", `0 0 ${w} ${h}`);

        // Gradient
        const defs = document.createElementNS(svgNs, "defs");
        const grad = document.createElementNS(svgNs, "linearGradient");
        grad.setAttribute("id", "grad");
        grad.setAttribute("x1", "0%");
        grad.setAttribute("y1", "0%");
        grad.setAttribute("x2", "0%");
        grad.setAttribute("y2", "100%");
        grad.innerHTML = `
            <stop offset="0%" style="stop-color:var(--accent);stop-opacity:0.2" />
            <stop offset="100%" style="stop-color:var(--accent);stop-opacity:0" />
        `;
        defs.appendChild(grad);
        svg.appendChild(defs);

        // Fill Area
        const areaPath = document.createElementNS(svgNs, "polygon");
        const firstPoint = points.split(' ')[0];
        const lastPoint = points.split(' ')[points.split(' ').length - 1];
        const areaPoints = `${pad},${h} ${points} ${w-pad},${h}`;
        areaPath.setAttribute("points", areaPoints);
        areaPath.setAttribute("fill", "url(#grad)");
        svg.appendChild(areaPath);

        // Line
        const polyline = document.createElementNS(svgNs, "polyline");
        polyline.setAttribute("points", points);
        polyline.setAttribute("fill", "none");
        polyline.setAttribute("stroke", "var(--accent)");
        polyline.setAttribute("stroke-width", "2");
        polyline.setAttribute("stroke-linecap", "round");
        polyline.setAttribute("stroke-linejoin", "round");
        svg.appendChild(polyline);

        container.innerHTML = '';
        container.appendChild(svg);
    }

    // Start
    init();

</script>
</body>
</html>
